import React from "react";
import Card from "./Card";
import Ndata from "./Ndata";


const Amaz = () =>{

    return (    
            <Card 
            key={Ndata[2].id}
            imgscr ={Ndata[2].imgscr} 
            title = {Ndata[2].title} 
            sname = {Ndata[2].sname} 
            link = {Ndata[2].link}                 
            />
       
    );
}

export default Amaz;
